                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }

        listRole = areaservices.ViewRole();
        voucherType = areaservices.ViewVoucherType();
        setting.VoucherTypeId = 0;
        priviliage.RoleId = 0;
        setting.NegativecashTransaction = "Warn";
        setting.NegativestockStatus = "Warn";
        setting.StockvaluecalculationMode = "Average Cost";
        setting.DateLanguage = "Nepali";
        setting.Suffix = string.Empty;
        setting.Prefix = string.Empty;
        StateHasChanged();
    }
    protected void RoleClicked()
    {
        if (priviliage.RoleId > 0)
        {
            string strSettingType = "Account";
            var checkRole = areaservices.CheckRoleId(priviliage.RoleId);
            if (checkRole != null)
            {
                listPrivilege = areaservices.ViewListPrivilige(CompanyId, priviliage.RoleId, strSettingType);
            }
            else
            {
                listPrivilege = areaservices.ViewListPrivilige(CompanyId, 1, strSettingType);
            }
        }
        else
        {
            listPrivilege.Clear();
        }
    }
    protected void VoucherTypeClicked()
    {
        if (setting.VoucherTypeId > 0)
        {
            setting = areaservices.EditInventorySetting(setting.VoucherTypeId);
        }
        else
        {
            setting.VoucherTypeId = 0;
        }
    }
    void SaveSetting()
    {
        if (strAdd == true)
        {
            if (setting.VoucherTypeId == 0)
            {
                Toaster.Add("Choose VoucherType.", MatToastType.Success, "Setting", null);
            }
            else
            {
                setting.WidthOfNumericalPart = 1;
                areaservices.UpdateInventorySetting(setting);
                Toaster.Add("Updated Successfully.", MatToastType.Success, "Setting", null);
                navManager.NavigateTo("settings");
            }
        }
        else
        {
            Toaster.Add("You dont have to privilege.", MatToastType.Success, "Dashboard", null);
            navManager.NavigateTo("dashboard");
        }
    }
